import classes from "./Resources.module.css";

function ResourcesPage() {
  return (
    <div className={classes.body}>
      <section>
        <h1>Check out my podcasts!</h1>
      </section>
      <section>
        <h2>Podcasts on spotify coming soon!</h2>
      </section>
    </div>
  );
}

export default ResourcesPage;
